const edgeMetrics = this.datasource;
if (Object.keys(this.datasource.stats).length === 0 && this.datasource.constructor === Object)
    return [];
let edge_key;
for (var prop in edgeMetrics["history"]) {
    edge_key = prop || null;
}
if(edge_key) {
    const memfree = 100-edgeMetrics.stats[edge_key]["memUsed(%)"]
    const memused = edgeMetrics.stats[edge_key]["memUsed(%)"]

    return [{"name": "Free RAM (%)", "data": memfree.toFixed(2)}, {"name": "Used RAM (%)", "data": (memused).toFixed(2)}];
}

var property="cpu(%)";
var ds=[];
var dataPlotReduction=1;

if (isObject(this.datasource.history)) {
    for(var i in this.datasource.history[Object.keys(this.datasource.history)][property]) {
        ds.push({
            "cpu (%)":parseFloat(this.datasource.history[Object.keys(this.datasource.history)][property][i]).toFixed(3)*1,
            timestamp:new Date(i.split(" m=+")[0]).toISOString()
        });
    }
}

var sds=[];
for (var x=0; x<ds.length;x=x+dataPlotReduction) {
    sds.push(ds[x])
}
return sds.reverse();

function isObject(obj) {
    for (var key in obj) {
        if (hasOwnProperty.call(obj, key)) return true;
    }
    return false;
}

